function padIntoTwoDigitString(t){return t.toString().padStart(2,"0")}function replaceTextContent(t,e,n){t.textContent=t.textContent.replace(e,n)}function renderDate(){let t=new Date,e=t.getFullYear(),n=padIntoTwoDigitString(t.getMonth()+1),o=padIntoTwoDigitString(t.getDate()),a=document.getElementsByClassName("js-date");for(let t=0;t<a.length;t++){let r=a[t];replaceTextContent(r,/yyyy/g,e),replaceTextContent(r,/mm/g,n),replaceTextContent(r,/dd/g,o)}}function renderMaths(){let t=document.getElementsByClassName("js-maths");for(let e=0;e<t.length;e++){let n=t[e];katex.render(n.textContent,n,{displayMode:"DIV"==n.tagName,throwOnError:!1})}}